    - ID: "625f32a7-8b24-4b35-8f6f-1464da77bc40"
      Hint: Content
      Value: |
        <div class="text-wrapper">
        <p>At Central Life Sciences, insect control is at the core of everything we do. Smart IGRs. Environmentally sound adulticides. First-in-class combinations. We are insect authentic, and we’re proud of that. This is our science that began with the development of the first biological insect growth regulators (IGRs) (S)-methoprene, (S)-hydroprene and (S)-kinoprene, and has kept us at the forefront of insect control technologies for nearly 50 years.</p>
        <p>At Central Life Sciences, we’re with you in the field every day from dawn until dusk. We manufacture and market some of the most recognized professional and consumer brands in the agriculture, animal health, specialty pest control and public health/vector control markets. When we wake up in the morning, we’re motivated to turn our science into solutions that help you thrive.</p>
        </div>
